import React, {FC, useState} from 'react';
import {Box, Text, Flex, Button} from '@chakra-ui/react';
//FC for functional component
interface MainProps {
    account: string;
}
const Main: FC<MainProps> = ({account}) => {
    const [newAnimalCard,setNewAnimalCard]=useState<string>();
    return <Flex w="full" h="100vh" justifyContent="center" alignItems="center">
        <Box>
            {newAnimalCard ? <div>AnimalCard</div>: <Text> Let's mint Animal Card</Text>}
        </Box>
        <Button>
            Mint
        </Button>
    </Flex>;
}

export default Main
